import React from 'react';
import "./Dash.css";
import { Link } from 'react-router-dom';
import emoji from 'react-easy-emoji';

export default function DashNav() {
       return (
              <div id='dashboard-list'>
                     <nav id='vert-nav' className="navbar navbar-expand-lg ">

                            <div className="container-fluid">
                                   <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
                                          <span className="navbar-toggler-icon"></span>
                                   </button>
                                   <div className="collapse navbar-collapse" >
                                          <ul id="navbar-ul" className="navbar-nav">
                                                 <li className="nav-item">
                                                        <a id='ddash' className="nav-link" href="#">DashBoard +</a>
                                                 </li>
                                                 <div id='list-lins'>
                                                        <li className="nav-item">
                                                               <a className="nav-link" href="####"> {emoji("üß©")}&nbsp;Ananlytics</a>
                                                        </li>
                                                        <li className="nav-item">
                                                               <a className="nav-link" href="####">{emoji("üìÖ")}&nbsp;Calendar</a>
                                                        </li>
                                                        <li className="nav-item">
                                                               <a href="####"> <Link to="/Contact">{emoji("‚òéÔ∏è")}&nbsp;Contact</Link></a>
                                                        </li>


                                                        <li className='nav-item'>
                                                               <a className="nav-link" href="####">{emoji("üõí")}&nbsp;Ecommerce</a>
                                                        </li>

                                                        <li className="nav-item">
                                                               <a className="nav-link" href="####">{emoji("üì©")} &nbsp;Mailbox</a>
                                                        </li>

                                                        <li className="nav-item">
                                                               <a className="nav-link" href="####"> {emoji("‚éâ")}&nbsp;Tasks</a>
                                                        </li>

                                                        <li className="nav-item">
                                                               <a className="nav-link" href="####"> {emoji("üîê")}&nbsp;Authentication</a>
                                                        </li>

                                                        <li className="nav-item">
                                                               <a className="nav-link" href="####"> {emoji("ÔºÑ")}&nbsp;Pricing</a>
                                                        </li>
                                                 </div>


                                                 <li className="nav-item dropdown">
                                                                      <a className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                                                                             Services
                                                                      </a>
                                                                      <ul className="dropdown-menu" aria-labelledby="navbarDropdown">
                                                                             <li><a className="dropdown-item" href="#">Service 1</a></li>
                                                                             <li><a className="dropdown-item" href="#">Service 2</a></li>
                                                                             <li><hr className="dropdown-divider"></hr></li>
                                                                             <li><a className="dropdown-item" href="#">Other Services</a></li>
                                                                      </ul>
                                                               </li>

                                          </ul>
                                   </div>
                            </div>
                     </nav>
              </div>



       );
};







